import React from "react";
import { Link } from "react-router-dom";

//import css
import './nav.css'

export const Nav = () => {
    return(
        <>
            <div className = 'div_nav'>
                <nav className = 'nav'>
                    <Link to = '/home'>
                        <img className = 'img_nav' src="https://images.vexels.com/media/users/3/144928/isolated/preview/ebbccaf76f41f7d83e45a42974cfcd87-ilustracion-de-perro.png" alt="" />
                        <h1 className = 'title_nav'>Henry</h1>
                        <h1 className = 'title_nav_dogs'>Dogs</h1>
                    </Link>
                    <Link to = '/add'>
                        <hr className = 'hr_nav'/>
                        <p className = 'p_nav'>Agregar raza</p>
                        <hr className = 'hr_nav' />
                    </Link>
                </nav>
            </div>  
        </>
    )
};
